function Cupom() {

    return (
        <div>
            <div className="banner-cupom">
                <div className="banner-info">
                    <h1>APROVEITE AGORA</h1>
                    <CouponIcon />
                    <p>CUPOM: HTMLNAOELINGUAGEM</p>
                </div>
            </div>
        </div>
    );
}

export default Cupom;
